import React from 'react';
import { Layout} from 'antd';

const { Content} = Layout;

function ContentAdmin() {
    return (
        <Content style={{ margin: '24px 16px 0', overflow: 'initial' }}>
        <div className="site-layout-background">
          content
        </div>
      </Content>
    );
}

export default ContentAdmin;
